  $scope.showHelp = function(arg) {
        $.SmartMessageBox({
            title : "What is Regular Expression ?",
            content : "Regular expressions give you control over what the user can give as input. There are two main differences between regular expressions and input mask,With regular expressions it is possible to make more complex validations; with an input mask it is not possible to have variable elements in your constrain. So a regular expression can be used to check if the input form an email adress is anything@anything.anything, which is not possible with input masks, as all the positions are fixed. </br>To implement a regular expressions, in wdget design, click on input field, then click on the icom on the side of the pattern property to displat the regular expressions available, click apply then click apply.",
            buttons : '[Ok]'
        });
};

